func TestSign87(t *testing.T) {
	var seed [32]byte
	for _, c := range sigGen87InternalProjectionCases {
		sk, _ := hex.DecodeString(c.sk)
		pk, _ := hex.DecodeString(c.pk)
		sig, _ := hex.DecodeString(c.sig)
		mu, _ := hex.DecodeString(c.mu)
		priv, err := NewPrivateKey87(sk)
		if err != nil {
			t.Fatalf("NewPrivateKey87 failed: %v", err)
		}
		sig2, err := priv.signInternal(seed[:], mu)
		if err != nil {
			t.Fatalf("failed to sign: %v", err)
		}
		if !bytes.Equal(sig2[:lambda256/4], sig[:lambda256/4]) {
			t.Errorf("signature mismatch(signer's commitment hash): got %x, want %x", sig2[:lambda256/4], sig[:lambda256/4])
		}
		if !bytes.Equal(sig2[lambda256/4:lambda256/4+encodingSize20*l87], sig[lambda256/4:lambda256/4+encodingSize20*l87]) {
			t.Errorf("signature mismatch(signer's response): got %x, want %x", sig2[lambda256/4:lambda256/4+encodingSize20*l87], sig[lambda256/4:lambda256/4+encodingSize20*l87])
		}
		if !bytes.Equal(sig2[lambda256/4+encodingSize20*l87:], sig[lambda256/4+encodingSize20*l87:]) {
			t.Errorf("signature mismatch(hint): got %x, want %x", sig2[lambda256/4+encodingSize20*l87:], sig[lambda256/4+encodingSize20*l87:])
		}
		pub, err := NewPublicKey87(pk)
		if err != nil {
			t.Fatalf("NewPublicKey87 failed: %v", err)
		}
		if !pub.verifyInternal(sig, mu) {
			t.Error("signature verification failed")
		}
	}
}

