func TestVerify87(t *testing.T) {
	for _, c := range sigVer87InternalProjectionCases {
		//sk, _ := hex.DecodeString(c.sk)
		pk, _ := hex.DecodeString(c.pk)
		sig, _ := hex.DecodeString(c.sig)
		msg, _ := hex.DecodeString(c.message)
		ctx, _ := hex.DecodeString(c.context)

		pub, err := NewPublicKey87(pk)
		if err != nil {
			t.Fatalf("NewPublicKey87 failed: %v", err)
		}
		if pub.VerifyWithOptions(sig, msg, &Options{Context: ctx}) != c.passed {
			t.Errorf("Verify failed")
		}
	}
}

func BenchmarkKeyGen87(b *testing.B) {
	var d [32]byte
	rand.Read(d[:])
	b.ResetTimer()
	for b.Loop() {
		if _, err := NewKey87(d[:]); err != nil {
			b.Fatalf("NewKey44 failed: %v", err)
		}
	}
}

func BenchmarkSign87(b *testing.B) {
	var seed [32]byte
	c := sigGen87InternalProjectionCases[0]
	sk, _ := hex.DecodeString(c.sk)
	mu, _ := hex.DecodeString(c.mu)
	priv, err := NewPrivateKey87(sk)
	if err != nil {
		b.Fatalf("NewPrivateKey87 failed: %v", err)
	}
	b.ReportAllocs()
	b.ResetTimer()
	for b.Loop() {
		_, err := priv.signInternal(seed[:], mu)
		if err != nil {
			b.Fatalf("signInternal failed: %v", err)
		}
	}
}

func BenchmarkVerify87(b *testing.B) {
	c := sigVer87InternalProjectionCases[2]
	pk, _ := hex.DecodeString(c.pk)
	sig, _ := hex.DecodeString(c.sig)
	msg, _ := hex.DecodeString(c.message)
	ctx, _ := hex.DecodeString(c.context)

	pub, err := NewPublicKey87(pk)
	if err != nil {
		b.Fatalf("NewPublicKey87 failed: %v", err)
	}
	opts := &Options{Context: ctx}
	b.ReportAllocs()
	b.ResetTimer()
	for b.Loop() {
		if !pub.VerifyWithOptions(sig, msg, opts) {
			b.Errorf("Verify failed")
		}
	}
}
